import React, { Fragment } from "react";

const Search = () => {
  return (
    <Fragment>
      <form className="form">
        <input
          type="text"
          name="text"
          value=""
          placeholder="Search Breweries..."
        />
        <input
          type="submit"
          value="Search"
          className="btn btn-dark btn-block"
        />
      </form>
    </Fragment>
  );
};

export default Search;
